/*!50003 CREATE*/ /*!50003 TRIGGER `Enrollment_Table_BEFORE_INSERT` BEFORE INSERT ON `Enrollment_Table` FOR EACH ROW BEGIN
    DECLARE total_credits INT;
    DECLARE new_credit INT;
    SELECT SUM(Credits) INTO total_credits
    FROM Enrollment_Table e
    JOIN Courses_Table c ON e.CRN = c.CRN
    WHERE e.NetId = NEW.NetId
    GROUP BY e.NetId;
    SELECT Credits INTO new_credit
    FROM Courses_Table c1
    WHERE c1.CRN = NEW.CRN;
    
    
    IF (total_credits + new_credit) >= 21 THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Student already has 21 or more credits';
    END IF;
END */;;
